post_text:
Dear Falcon Families;

Please know that I am currently meeting with JC leadership to discuss next steps for our dual enrolled students and further implications for JPEC. I will send a follow up communication and guidance to all later today. Please know that our buildings will be closed to students until April 6 per the Governor's mandate. I will be discussing with our team about transitioning to online courses, timelines, and supports for students during this time. This information will be communicated to all.

Shane

